'''DXMM-TV''' is a commercial television relay station owned by [[ABS-CBN Broadcasting Corporation]] in affiliation with the Sulu and Tawi-tawi Broadcasting Foundation. Its studio is located at Gandasuli, [[Jolo, Sulu]].
==ABS-CBN TV-10 Program== *[[TV Patrol Central Mindanao]] (simulcast on TV-5 Cotabato)
